INSERT INTO `wp_options` VALUES (550,'widget_serenity_testimonial','a:7:{i:1;a:4:{s:5:\"title\";s:16:\"Balikis Alagbala\";s:8:\"subtitle\";s:18:\"Abeokuta Pensioner\";s:9:\"image_url\";s:0:\"\";s:8:\"textarea\";s:131:\"I just got onboarded at Penaid, the registration process was not bad at all just get the necessary documents and you\'re good to go.\";}i:2;a:4:{s:5:\"title\";s:16:\"Ibrahim Sulaimon\";s:8:\"subtitle\";s:16:\"Ibadan Pensioner\";s:9:\"image_url\";s:0:\"\";s:8:\"textarea\";s:113:\"Penaid has helped me pay my kids school fees and be able to sort my house rent in due time. \r\nThey are fantastic.\";}i:3;a:4:{s:5:\"title\";s:10:\"Mary Alaba\";s:8:\"subtitle\";s:18:\"Abeokuta Pensioner\";s:9:\"image_url\";s:77:\"https://demo.themely.com/serenity/wp-content/uploads/2019/04/testimonial1.jpg\";s:8:\"textarea\";s:112:\"Penaid has always helped pensioners in need and continue helping us. \r\nYou will not regret using their services!\";}i:4;a:4:{s:5:\"title\";s:10:\"James Buba\";s:8:\"subtitle\";s:14:\"Kogi Pensioner\";s:9:\"image_url\";s:0:\"\";s:8:\"textarea\";s:118:\"I love their service and was so amazed with their support when i was troubled receiving my pension.\r\nThey are awesome.\";}i:5;a:4:{s:5:\"title\";s:12:\"Eric Johnson\";s:8:\"subtitle\";s:16:\"Kaduna Pensioner\";s:9:\"image_url\";s:0:\"\";s:8:\"textarea\";s:134:\"I just finished paying my first loan, it\'s so convenient, straight forward and the result was so amazing.\r\nThey are truly here for us.\";}i:6;a:4:{s:5:\"title\";s:11:\"Mrs. Waziri\";s:8:\"subtitle\";s:6:\"Sokoto\";s:9:\"image_url\";s:72:\"https://demo.themely.com/serenity/wp-content/uploads/2019/04/team2-1.jpg\";s:8:\"textarea\";s:112:\"All their staffs are so respectful with kind hearts, i wish to go back there everyday but i have other runnings.\";}s:12:\"_multiwidget\";i:1;}','yes');
