INSERT INTO `wp_posts` VALUES (429,1,'2020-10-27 15:34:43','2020-10-27 15:34:43','<p><![CDATA[\n</p]]></p>\n<!-- wp:paragraph -->\n<p>At Penaid, we believe that retirees can continue to have a significant impact in our society.</p>\n<p>Our goal is to enable retirees remain economically active by increasing their capacity to create and maintain to productive and profit generating enterprises.</p>\n<p>We accomplish this through the provision of information, education and access to finance.</p>\n<p>the welfare of r</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph --><!-- /wp:paragraph -->','About','','inherit','closed','closed','','159-autosave-v1','','','2020-10-27 15:34:43','2020-10-27 15:34:43','',159,'http://penaidltd.local/159-autosave-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (430,1,'2020-10-27 15:35:37','2020-10-27 15:35:37','<p><![CDATA[\r\n</p]]></p>\r\n<!-- wp:paragraph -->\r\n<p>At Penaid, we believe that retirees can continue to have a significant impact in our society.</p>\r\n<p>Our goal is to enable retirees remain economically active by increasing their capacity to create and maintain to productive and profit generating enterprises.</p>\r\n<p>We accomplish this through the provision of information, education and access to finance.</p>\r\n<p>the welfare of retirees is of paramount importance to us and all our efforts are geared towards improving the quality of life of retirees.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->','About','\n				<![CDATA[]]>		','inherit','closed','closed','','159-revision-v1','','','2020-10-27 15:35:37','2020-10-27 15:35:37','',159,'http://penaidltd.local/159-revision-v1/',0,'revision','',0);
INSERT INTO `wp_posts` VALUES (431,1,'2020-10-27 15:36:01','2020-10-27 15:36:01','<!-- wp:paragraph -->\r\n<p>At PenAid, we believe that retirees can continue to have a significant impact in our society.</p>\r\n<p>Our goal is to enable retirees remain economically active by increasing their capacity to create and maintain to productive and profit generating enterprises.</p>\r\n<p>We accomplish this through the provision of information, education and access to finance.</p>\r\n<p>the welfare of retirees is of paramount importance to us and all our efforts are geared towards improving the quality of life of retirees.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph --><!-- /wp:paragraph -->','About','\n				<![CDATA[]]>		','inherit','closed','closed','','159-revision-v1','','','2020-10-27 15:36:01','2020-10-27 15:36:01','',159,'http://penaidltd.local/159-revision-v1/',0,'revision','',0);
